import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Ajusta la ruta de tu archivo CSS si es necesario
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

export default class Menu extends React.Component {
    render() {
        return (
            <Navbar bg="light" expand="md" fixed="top">
                <Navbar.Brand href="#">
                    <img src="./img/SSU.png" alt="Logo SSU" style={{ maxWidth: '50px', height: 'auto' }} />
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Link to="/" className="nav-link">Inicio</Link>
                        <Link to="/nosotros" className="nav-link">Sobre Nosotros</Link>
                        <Link to="/jugadores" className="nav-link">Jugadores</Link>
                        <Link to="/contacto" className="nav-link">Contacto</Link>
                        <Link to="/otros" className="nav-link">Â¿Quieres conocer otros juegos?</Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        );
    }
}
